/*Table structure for table `classoa_region` */

DROP TABLE IF EXISTS `classoa_region`;

CREATE TABLE `classoa_region` (
  `region_id` smallint(5) NOT NULL AUTO_INCREMENT COMMENT 'region_id',
  `parent_id` smallint(5) NOT NULL DEFAULT '0' COMMENT '上级地区ID',
  `region_name` varchar(120) NOT NULL DEFAULT '' COMMENT '地区名',
  `show_name` varchar(120) NOT NULL COMMENT '前台显示名称',
  `region_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '类型（用于扩展)',
  `area_code` varchar(50) NOT NULL DEFAULT '' COMMENT '区域代码',
  `sfairline` varchar(20) NOT NULL DEFAULT '0' COMMENT '航空配送条件',
  `sfshipping` varchar(20) NOT NULL DEFAULT '0' COMMENT '配送条件',
  `municipality` tinyint(1) DEFAULT '0' COMMENT '是否是直辖市 0否 1是',
  `status` int(2) NOT NULL DEFAULT '0' COMMENT '0:代表未开通，1代表开通',
  `is_complement` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否系统补码(0:系统自动补码，1:自查补码)',
  `other_areacode` varchar(50) NOT NULL COMMENT '区域码',
  `is_sfv` tinyint(1) DEFAULT '0' COMMENT '1时令能配送 0 优选地址',
  `ship_time` int(11) NOT NULL DEFAULT '0' COMMENT '配送时效',
  `sfv_region_id` int(8) DEFAULT '0' COMMENT '时令地址库id',
  `sort` int(6) DEFAULT '0' COMMENT '排序字段',
  `operater_time` int(11) NOT NULL DEFAULT '0' COMMENT '操作时间',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未删除 1已删除',
  `created_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `modified_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `city_code` varchar(20) NOT NULL DEFAULT '0' COMMENT '城市code',
  PRIMARY KEY (`region_id`),
  KEY `idx_parentid` (`parent_id`),
  KEY `idx_modifiedTime` (`modified_time`)
) ENGINE=InnoDB AUTO_INCREMENT=17625 DEFAULT CHARSET=utf8 COMMENT='市区县数据字典';

