/*Table structure for table `classoa_register` */

DROP TABLE IF EXISTS `classoa_register`;

CREATE TABLE `classoa_register` (
  `register_id` int(10) NOT NULL AUTO_INCREMENT,
  `inst_name` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `applicant` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `class_type` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `student_ages` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `wechat` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `remark` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `inst_id` int(10) NOT NULL,
  `is_online` int(1) DEFAULT NULL COMMENT '是否线上教育 0：否  1：是',
  `province` int(5) DEFAULT NULL,
  `city` int(5) DEFAULT NULL,
  `district` int(5) DEFAULT NULL,
  PRIMARY KEY (`register_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

