  `interested_class` int(10) DEFAULT NULL COMMENT 'classtype_id',
  PRIMARY KEY (`student_id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

